		function pageSort(a, b) {
			var va = (a.Page === null) ? "" : "" + a.Page,
				vb = (b.Page === null) ? "" : "" + b.Page;
			return va.localeCompare(vb);
		}
		function sumClicks(vals) {
			if (vals.length < 1) return vals[0].Clicks;
			return vals.reduce(function (total, cur) {
				return total + cur.Clicks;
			}, 0);
		}
		function countInitDoc(vals, column) {
			if (vals.length < 1) return vals[0].InitDoc ? 1 : 0;
			return vals.reduce(function (total, cur) {
				return total + (cur.InitDoc ? 1 : 0);
			}, 0);
		}

		function docSort(a, b) {

				bIndex = docOrder.indexOf(b.Document);

				return -1;
			if (aIndex > bIndex)
				return 1;
			else if (aIndex < bIndex)
				return -1;
			return 0;
		}
